const NewPet = ({
    handleSubmit, petName, setPetName, petType, setPetType, dob, setDob, gender, setGender, sterilised, setSterilised, petDesc, setPetDesc
}) => {
    return (
        <main className="NewPost">
            <h2>New Pet</h2>
            <form className="newPostForm" onSubmit={handleSubmit}>
                <label htmlFor="postTitle">Pet Name:</label>
                <input
                    id="postTitle" // match with htmlFor attribute
                    type="text" // accept text input
                    required
                    value={petName}
                    onChange={(e) => setPetName(e.target.value)}
                />
                <input
                    id="postTitle" // match with htmlFor attribute
                    type="text" // accept text input
                    required
                    value={petType}
                    onChange={(e) => setPetType(e.target.value)}
                />
                <input
                    id="postTitle" // match with htmlFor attribute
                    type="text" // accept text input
                    required
                    value={dob}
                    onChange={(e) => setDob(e.target.value)}
                />
                <input
                    id="postTitle" // match with htmlFor attribute
                    type="text" // accept text input
                    required
                    value={gender}
                    onChange={(e) => setGender(e.target.value)}
                />
                <input
                    id="postTitle" // match with htmlFor attribute
                    type="text" // accept text input
                    required
                    value={sterilised}
                    onChange={(e) => setSterilised(e.target.value)}
                />

                <label htmlFor="postBody">Post:</label>
                <textarea
                    id="postBody" // match with htmlFor attribute
                    required
                    value={petDesc}
                    onChange={(e) => setPetDesc(e.target.value)}
                />
                <button type="submit">Submit</button>
            </form>
        </main>
    )
}

export default NewPet
